import React from "react";
import Data from "./data";

const List = () => {
    const people = Data;
    return (
        <>
            {people.map((person) => {
                const { id, name, age, image } = person;
                return (
                    <>
                        <div>
                            <img
                                src={image}
                                className="person"
                                alt="profile image"
                            />
                        </div>
                        <div key={id}>
                            <h4>{name}</h4>
                            <p>{age} years</p>
                        </div>
                    </>
                );
            })}
        </>
    );
};

export default List;
